import React from 'react'
import { Icon, Label, Menu, Table, Container, Tab } from 'semantic-ui-react'

const TableData = ({stats, events}) => {
    const displayData = () => {
        if(stats){
            stats.map( (data, i) => {
                return(
                    <Table.Row key={i}>
                                <Table.Cell>{data.date}</Table.Cell>
                                <Table.Cell>{data.hour}</Table.Cell>
                                <Table.Cell>{data.impressions}</Table.Cell>
                                <Table.Cell>{data.clicks}</Table.Cell>
                                <Table.Cell>{data.revenue}</Table.Cell>
                                <Table.Cell>{data.poi_id}</Table.Cell>
                    </Table.Row>
                )
            });
        }
        return 
    }

    return (
        <Container>
              <Table striped>
                <Table.Header>
                    <Table.Row>
                        <Table.HeaderCell>Date</Table.HeaderCell>
                        <Table.HeaderCell>Hour</Table.HeaderCell>
                        <Table.HeaderCell>Impressions</Table.HeaderCell>
                        <Table.HeaderCell>Clicks</Table.HeaderCell>
                        <Table.HeaderCell>Revenue</Table.HeaderCell>
                        <Table.HeaderCell>POI ID</Table.HeaderCell>
                    </Table.Row>
                </Table.Header>

                <Table.Body>
                    {displayData()}
                </Table.Body>
            </Table>
        </Container>
    );
}

export default TableData;
